description:
This software has been tested on Windows 7 Ultimate x86 and it works if you follow instructions below. It may also work on other versions of Windows but you will have to test it for yourself. 
If you have problems running this software on x64 bit edition of windows check this link: http://www.passatworld.com/forums/volkswagen-passat-b5-discussion/303177-vag-com-409-1-3rd-party-windows-7-64-bit.html

Install instructions:
1. Launch &quot;VAG-COM 409.1 release.exe&quot;;
2. Change destination folder to &quot;C:VAG-COM&quot;. Do not install to &quot;Program Files&quot;;
3. After installation finishes move &quot;VAG-COM Release 409-1&quot; shortcut from your desktop to folder &quot;VAG-COM loader&quot;;
4. Use &quot;Launcher.bat&quot; to launch application.

Do not close launcher window (the black one) until you finish using the app. The launcher is making app registered during the time of using. If you launch app without using the launcher you will soon notice that app is no longer registered and you will not be able to use all features
